// rafce -> shortcut
import React, { useState } from "react";
import logo from './imgs/logo.png';
import { Squash as Hamburger } from "hamburger-react";
import NavBarOpen from "./NavBarOpen";
import hu from './imgs/hu.png';


const Navbar = () => {
  const [isOpen, setOpen] = useState(false);

  return (
    <div>
      <nav className="navbar">
        <img src={logo} alt="" className="logo" />
        <ul className="nav-links">
          <li>
            <a href="/">Autókölcsönzés</a>
          </li>
          <li>
            <a href="/">Modelljeink</a>
          </li>
          <li>
            <a href="/">Rólunk</a>
          </li>
          <li>
            <a href="/">Hűségprogram</a>
          </li>
          <li>
            <a href="/">Bejelentkezés</a>
          </li>

         <li className="lang_select"><select name="language" id="language">
            <option id="hu" value="hu" icon={hu} label="Magyar"></option>
            <option id="en" value="en" label="Magyar"></option>

          </select> 
          </li> 


        </ul>
        <Hamburger toggled={isOpen} toggle={setOpen} />
      </nav>
      {isOpen ? <NavBarOpen /> : <navbar />}
    </div>
  );
};

export default Navbar;
